import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  container: {
    height: '100%',
    paddingHorizontal: '8%',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  input: {
    marginBottom: '6%',
  },
  button: {
    width: '100%',
  },
  link: {
    marginTop: '5%',
  },
});
